const sortArrayByParityII = array => {
    const evenArr = [];
    const oddArr = [];
    for(let i=0;i<array.length;i++){
        if(array[i] % 2 === 0){
            evenArr.push(array[i]);
        } else {
            oddArr.push(array[i]);
        }
    }
    return mergeSortedArrays(evenArr, oddArr);
};

