const mergeTwoSortedArrays = (arr1, arr2) => {
    let result = [];
    while(arr1.length && arr2.length){
        if(arr1[0] < arr2[0]){
            result.push(arr1.shift());
        } else {
            result.push(arr2.shift())
        }
    }
    return [...result,...arr1,...arr2];
}

