        if (!charMap[string[i]]) {
            charMap[string[i]] = 1;
        } else {
            charMap[string[i]]++;
        }
    }

    for (let j = 0; j < string.length; j++) {
        if (charMap[string[j]] === 1) {
            return string[j];
        }
    }
}

