  }
  for (let char of s) {
    if (!stack.includes(char)) {
      while (
        stack.length &&
        stack[stack.length - 1] > char &&
        countMap[stack[stack.length - 1]]--
      ) {
        stack.pop();
      }
      stack.push(char);
    } else {
