function compress(chars) {
    let i = 0;
    while (i < chars.length - 1) {
        if (chars[i] === chars[i + 1]) {
            const count = 2;
            for (let j = i + 1, k = i + count; j < k && k <= chars.length; j++, k++) {
                chars[k] = chars[j];
            }
            i += count;
        } else {
            i++;
        }
    }
}

