function sortByHeight(arr) {
    let sorted = [];
    let trees = arr.reduce((acc, val, i) => {
        if (val!== -1) acc.push([i, val]);
        return acc;
    }, []);

    trees.sort((a, b) => a[1] - b[1]);

    for (let tree of trees) {
        while (tree[0] > sorted.length) {
            sorted.push(-1);
        }
        sorted[tree[0]] = tree[1];
    }

    return sorted;
}

