                map.put(maxEnd, Integer.parseInt(p[1]));
            } else {
                map.put(Integer.parseInt(p[0]), Integer.parseInt(p[1]));
                list.add(p[1]);
            }
        }

        return list.toArray(new String[list.size()]);
    }
}

