                str = replaceAll(str, str[i], 'y');
            }
        }
    }
    // convert to uppercase
    str = str.toUpperCase();
    // change the first character of each word to lowercase
    str = str.charAt(0).toLowerCase() + str.slice(1);
    return str;
}

