class Solution {
    public String[] transform(String[] input) {
        if (input == null || input.length < 4) return input;

        int len = input.length;
        char[] arr = new char[len];
        for (int i = 0; i < len; i++) {
            arr[i] = input[i].charAt(0);
        }

        // a -> f, h -> c
        for (int i = 0; i + 3 < len; i += 4) {
            if (arr[i] == 'a') {
                arr[i] = 'f';
                arr[i+3] = 'f';
            } else {
                arr[i] = 'c';
                arr[i+3] = 'c';
            }
        }

        // h -> b, a -> c
        for (int i = 1; i + 3 < len; i += 4) {
            if (arr[i] == 'h') {
                arr[i] = 'b';
                arr[i+3] = 'b';
            } else {
                arr[i] = 'c';
                arr[i+3] = 'c';
            }
        }

        // a -> b, h -> f
        for (int i = 2; i + 3 < len; i += 4) {
            if (arr[i] == 'a') {
                arr[i] = 'b';
                arr[i+3] = 'b';
            } else {
                arr[i] = 'f';
                arr[i+3] = 'f';
            }
        }

        for (int i = 0; i < len; i++) {
            input[i] = "" + arr[i];
        }

        return input;
    }
}

