    for (let i = 0; i < arr.length; i++) {
        if (arr[i] === "a") {
            aCount++;
        } else {
            break;
        }
    }

    let fCount = 0;
    for (let j = arr.length - 1; j >= 0; j--) {
        if (arr[j] === "f") {
            fCount++;
