// Solution 1:
class Solution {
public:
    vector<char> replace(vector<char>& input) {
        int len = input.size();
        if (len == 0) return {};

        // find the first g
        for (int i=0; i<len-1; ++i) {
            if (input[i]=='g') break;
        }

        // no g found, just return a copy of input
        if (i==len-1) return input;

        // count f and d
        int cntF = 0, cntD = 0;
        for (int j=i+1; j<len; ++j) {
            if (input[j]=='g') {
                ++cntD;
            } else {
                ++cntF;
            }
        }

        // fill in result array
        vector<char> res(len);
        for (int k=0; k<i; ++k) {
            res[k] = input[k];
        }
        for (int l=0; l<cntF; ++l) {
            res[i+l] = 'f';
        }
        for (int m=0; m<cntD; ++m) {
            res[len-1-m] = 'd';
        }

        return res;
    }
};

