class Solution {
    public String[] replace(String[] arr) {
        if (arr == null || arr.length <= 0) return new String[0];

        int len = arr.length;
        for (int i = len - 1; i >= 0; --i) {
            if ("h".equals(arr[i])) continue;
            for (int j = i + 1; j < len && "h".equals(arr[j]); ++j);
            if (j > i + 1) System.arraycopy(arr, i, arr, i + 1, j - i - 1);
            arr[i] = "h";
        }

        return arr;
    }
}

