class Solution {
    public String[] replace(String[] arr) {
        if (arr == null || arr.length <= 0) return new String[0];

        Stack<Integer> stack = new Stack<>();
        for (int i = 0; i < arr.length; ++i) {
            if (!"h".equals(arr[i])) {
                while (!stack.isEmpty() && "h".equals(arr[stack.peek()])) {
                    arr[stack.pop()] = arr[i];
                }
                stack.push(i);
            }
        }

        while (!stack.isEmpty()) {
            arr[stack.pop()] = "h";
        }

        return arr;
    }
}

