// Solution 1:
const longestCommonSubsequence = (str) => {
    if (!str.length) return '';

    const [first,...rest] = str;
    let result = first;

    for (let i = 0; i < rest.length; i++) {
        if (rest[i] === first) continue;

        result += rest[i];
    }

    return longestCommonSubsequence(result);
};

